import styled from "styled-components"
import { Link, useNavigate } from "react-router-dom";

export default function ComprarPlano({ img, calendar, money }) {
    return (
        <>
            <TopBar>
                <img src={img} alt="" />
                <p>Driven Plus</p>
            </TopBar>
            <Info>
                <Beneficio>
                    <img src={calendar} alt="" />
                    <p>Benefício</p>
                </Beneficio>

                <ComponentBox>
                    <p>1. Brindes exclusivos</p>
                    <p></p>2. Materiais bônus de web
                </ComponentBox>
            </Info>

        </>
    )
}

const TopBar = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 87px 38px 24px 38px;
    color: #FFFFFF;
    font-weight: 700;
    font-size: 32px;
    line-height: 38px;
    img{
        width: 139.38px;
        height: 95.13px;
    }
`
const Info = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 299px;
    height: auto;
    background-color: red;
    margin: 0 auto;
`
const Beneficio = styled.div`
    display: flex;
    justify-content: start;
    align-items: center;
    margin: 0 auto;
    color:#FFFFFF;
    font-weight: 400;
    font-size: 16px;
    line-height: 19px;  
`
const ComponentBox = styled.div`
    margin-top: 10px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    color:#FFFFFF;
    font-size: 14px;
    line-height: 16px;
`
